import { StyleSheet, Text, View } from "react-native";
import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

const Tab = createBottomTabNavigator();

import Home from "./components/Home";
import consultaMensalidade from './components/consultaMensalidade';
import Lista from "./components/listaViagem";



export default function App() {
  return (
    <NavigationContainer style={styles.container}>
      <Tab.Navigator initialRouteName={"Home"}> 
      <Tab.Screen name="Início" component={Home} />
      <Tab.Screen name="Mensalidade" component={consultaMensalidade}  />
      <Tab.Screen name="Lista" component={ListaViagem}  />
      </Tab.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#DFDFDF",
    alignItems: "center",
    justifyContent: "center",
  },
});
